import Menu from './Menulayout'
import  $ from 'jquery'
import { useState } from 'react';

function Search() {
    
        const [count,sC]=useState(0)
    function elems(c){
        let arr=[];
        
        for(let i=0;i<c;i++){
            arr.push(<div draggable="true" onDragStart={
                (e)=>{}
            }key={i}>{i+1}</div>)
        }
        return arr
    }
    const [fav,setFav]=useState(elems(5));
   
    return (<>
    <div className="mmm">
    {fav}
    </div>
    <div className="kk" onDragEnter={()=>{
        sC(count+1);
    const y=arr
    y.shift()
    setFav(y)

    }}>{count}</div>
    </>)

}
export default Search;



